import React, { Component } from "react";
class Dashboard extends Component {
  render() {
    let tdStyle = {
      paddingTop: "15px",
      boxShadow: "0 .125rem .25rem rgba(0,0,0,.075) !important"
    };
    return (
      <div className="container">
        <div className="row">
          <div className="col-md-3">Category</div>
          <div className="col-md-3">Item name</div>
          <div className="col-md-2">Amount</div>
          <div className="col-md-3">Expense date</div>
          <div className="col-md-1">Action</div>
        </div>
        <div className="row">
          <div className="col-md-3">Grocery</div>
          <div className="col-md-3">Bread</div>
          <div className="col-md-2">40</div>
          <div className="col-md-3">12 14 2109</div>
          <div className="col-md-1">
            {" "}
            <i class="fas fa-pen" /> | <i class="fas fa-divash-alt" /> |
            <i class="fas fa-undo" />
          </div>
        </div>
      </div>
    );
  }
}

export default Dashboard;
